package ansh;

public class MultiDim {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
      
		int ar[][] = {{1,2,3},{4,5,6},{2,2,2}};
		
		for(int i = 0;i<3;i++)
		{
			for(int j = 0;j<3;j++)
			{
				
				System.out.print(ar[i][j]+" ");
			}
		
	
		System.out.println();
		}}

}
